
--BORRAR TABLA
DROP TABLE SDAI_OWNER.SDAI_GRADUACION CASCADE CONSTRAINTS;
COMMIT;
--BORRAR LA SECUENCIA PARA QUE NO PROBLEMAS
DROP SEQUENCE SDAI_OWNER.SEC_SDAI_GRADUACION;
COMMIT;
--DESHABILITAR EL TRIGGER
DROP TRIGGER SDAI_OWNER.SDAI_GRADUACION_BII_TRG_01;
COMMIT;

--CREACION TABLA
CREATE TABLE SDAI_OWNER.SDAI_GRADUACION (
    COD_GRADUACION              NUMBER NOT NULL,
    COD_SIGES                   VARCHAR2(20) NOT NULL,
    DSC_GRADUACION              VARCHAR2(255 CHAR) NOT NULL,
    TIP_GRADUACION              NUMBER NOT NULL,
    CAN_DIOPTRIAS_ADICION       VARCHAR2(6 BYTE) NOT NULL,
    CAN_DIOPTRIAS_ESFERICO      VARCHAR2(6 BYTE) NOT NULL,
    CAN_DIOPTRIAS_CILINDRICO    VARCHAR2(6 BYTE) NOT NULL,
    COD_USUARIO_REGISTRO        VARCHAR2(100 BYTE),
    FEC_REGISTRO	            DATE,
    COD_USUARIO_MODIFICO        VARCHAR2(100 BYTE),
    FEC_MODIFICO	            DATE,
    LOG_ACTIVO	                CHAR(1 BYTE)
);


---COMENTARIOS DE LA TABLA AROS
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.COD_GRADUACION IS
    'codigo del tono.';
    
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.COD_SIGES IS
    'Codigo de tono en SIGES para compras';
    
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.DSC_GRADUACION IS
    'Descripcion de la Graduacion.';

COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.TIP_GRADUACION IS
    'tipo de graduacion.';
    
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.CAN_DIOPTRIAS_ADICION IS
    'Numero de adicion que tiene la dioptria.';
    
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.CAN_DIOPTRIAS_ESFERICO IS
    'Numero de esferico que tiene la dioptria.';
        
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.CAN_DIOPTRIAS_CILINDRICO IS
    'Numero de cilindro que tiene la dioptria.';
        
COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.COD_USUARIO_REGISTRO IS
    'Usuario que realiza el registro (auditoria).';

COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.FEC_REGISTRO IS
    'Fecha que se realiza el registro (auditoria)';

COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.COD_USUARIO_MODIFICO IS
    'Usuario que realiza la modificación del registro (auditoria)';

COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.FEC_MODIFICO IS
    'Fecha que se realiza la modificación del registro (auditoria)';

COMMENT ON COLUMN SDAI_OWNER.SDAI_GRADUACION.LOG_ACTIVO IS
    'Estado del registro (Activo=0, Inactivo=1)';    
    
---INDEX
CREATE INDEX SDAI_OWNER.SDAI_GRADUACION_PK ON SDAI_OWNER.SDAI_GRADUACION (COD_GRADUACION) TABLESPACE INDICES_01 ;
---PK
ALTER TABLE SDAI_OWNER.SDAI_GRADUACION ADD PRIMARY KEY (COD_GRADUACION) USING INDEX SDAI_OWNER.SDAI_GRADUACION_PK  ENABLE;
---SECUENCIA
CREATE SEQUENCE SDAI_OWNER.SEC_SDAI_GRADUACION START WITH 1 NOCACHE ORDER ;
---TRIGER
CREATE OR REPLACE TRIGGER SDAI_OWNER.SDAI_GRADUACION_BII_TRG_01 
BEFORE INSERT ON SDAI_OWNER.SDAI_GRADUACION 
FOR EACH ROW 
WHEN (NEW.COD_GRADUACION IS NULL) 
BEGIN
:new.COD_GRADUACION := SDAI_OWNER.SEC_SDAI_GRADUACION.nextval;
end;

--INSERT
